func TestWaysToSplit(t *testing.T) {
	for name, test := range tests {
		t.Run(name, func(t *testing.T) {
			t.Parallel()
			if expected, actual := test.output, ways_to_split.WaysToSplit(test.input); expected != actual {
				t.Errorf("want %d, got %d", expected, actual)
			}
		})
	}
}
